import React from "react";

export default class Mmore extends Component{
    constructor(props){
        this.state = {
            items: []
        };
    }

    render(){
        const {items}=this.state;
            return(
                <>
                <div className="Container bg-light border" >
                    {items.map(item=>(
                        <div key={items.name}>
                            <h3>
                            {item.strMeal}
                            </h3>
                            <img className="imgRecipe" src={item.strMealThumb} alt={item.strMeal}>
                            </img>
                            
                        </div>
                    ))}
                </div>
                </>
            );
    }
}
